import React from 'react'

export default function WorkoutItem(props) {


const opneWorkoutPage = () =>{
    props.changePage("workoutpage")

}
    

  return (
    <div>
        <button className='workoutButton' onClick ={opneWorkoutPage} disabled ={props.workouts.isDone}>
            <h4>Workout N.O {props.workouts.wNumber}</h4>
            <p>{props.workouts.km} KM </p>
        </button>
    </div>
  )
}
